import React, { useState } from "react";
import ReactDOM from "react-dom";

var [count, setCount] = useState();

function increase() {
  setCount(count + 1);
}
ReactDOM.render(
  <div className="container">
    <h1>{count}</h1>
    <button onClick={increase}>+</button>
  </div>,
  document.getElementById("root")
);
